import React from 'react';
import './404Page.css';

const NoMatch =({history}) =>{
    return(
        <div className='div-style'>
            <h2>404Page</h2>
            <p className='paragraph-style' >Redirecting to <span onClick={() => history.push('/')}>Login Page</span></p>
        </div>
    )
}

export default NoMatch;
